  <script src="https://ajax.googleapis.com/ajax/libs/jquery/3.7.1/jquery.min.js"></script>
  <style>
    * {
      box-sizing: border-box;
      font-size: 14px;
      margin: 0;
      padding: 0;
      font-size: 98.77% !important;
      line-height: 140.75% !important;
    }

    body {
      font-family: Arial, "Helvetica Neue", Helvetica, sans-serif;
      overflow: hidden;
      background-color: #000;
      font-size: 18px;
      color: #e2e2e2;
      max-width: 600px;
      margin: 0 auto
    }

    img {
      width: 100%
    }

    ul {
      list-style-type: none
    }

    .header {
      width: 100%;
      border-bottom: 1px solid #f90
    }

    .header__wrapper {
      display: flex;
      align-items: center;
      justify-content: space-between;
      height: 100%;
      position: relative;
      padding: 20px
    }

    .header__menu {
      width: 40px;
      height: 40px;
      padding: 7px 0 4px;
      border: 1px solid #616161;
      background: #161617;
      display: flex;
      align-items: center;
      justify-content: center;
      flex-direction: column
    }

    .header__menu span {
      background: #cccece;
      border-radius: 5px;
      display: block;
      height: 3px;
      width: 20px;
      margin-bottom: 4px
    }

    .header__menu span:last-child {
      margin-bottom: 0
    }

    .header__logo {
      line-height: 1;
      padding: 2px 16px;
      border-radius: 4px;
      color: #000;
      text-transform: uppercase;
      font-weight: 900;
      font-size: 2rem;
      position: relative;
      display: flex;
      align-items: center;
      justify-content: center;
      width: 240px
    }

    .header__text {
      width: 30%
    }

    .header__text:last-child {
      text-align: right
    }

    .header__list {
      padding: 20px;
      display: flex;
      align-items: center;
      justify-content: space-between;
      border-top: 1px solid #f90
    }

    .header__list-item {
      text-transform: uppercase
    }

    .header__list-item.item--active {
      color: #f90
    }

    .main {
      padding: 25px 0
    }

    .main__filter {
      margin-bottom: 12px;
      padding: 0 20px
    }

    .main__filter-list {
      display: flex;
      align-items: center;
      gap: 10px
    }

    .main__filter-item {
      padding: 6px 12px;
      text-align: center;
      font-size: 1.2rem;
      border: 1px solid #2d2d2d;
      background: #161617
    }

    .main__filter-item.item--active {
      color: #f90
    }

    .main__title {
      text-transform: uppercase;
      font-weight: 700;
      margin-bottom: 16px;
      font-size: 1.6rem;
      padding: 0 20px
    }

    .gallery__item {
      width: 100%;
      margin-bottom: 1rem
    }

    .gallery__item:last-child {
      margin-bottom: 0
    }

    .gallery__item .item__image {
      padding-top: 60%;
      position: relative;
      overflow: hidden
    }

    .gallery__item .item__image:before {
      content: '';
      position: absolute;
      top: 50%;
